import React, { useState, useEffect } from "react";

function SignupForm(){

    const [firstName, setFirstName] = useState("");
    const [lastName, setLastName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");

    let firstNameTemp
    let lastNameTemp
    let emailTemp
    let passwordTemp

    useEffect(() => {
        setFirstName(firstNameTemp);
        setLastName(lastNameTemp);
        setEmail(emailTemp);
        setPassword(passwordTemp);
    }, [firstNameTemp, lastNameTemp, emailTemp, passwordTemp]);

    return (
        <div id="container">
            <div id="content">
                <form>
                    <input
                        value={firstNameTemp}
                        placeholder="Voornaam"
                        type="text"
                        name="firstname"
                        required
                    />
                    <input
                        value={lastNameTemp}
                        placeholder="Achternaam"
                        type="text"
                        name="lastname"
                        required
                    />
                    <input
                        value={emailTemp}
                        placeholder="E-mailadres"
                        type="email"
                        name="email"
                        required
                    />
                    <input
                        value={passwordTemp}
                        placeholder="Wachtwoord"
                        type="password"
                        name="password"
                        required
                    />
                    <button type="submit">Registreer</button>
                    Welkom
                    {console.log(firstName)}
                    {console.log(lastName)}
                </form>
            </div>
        </div>
    );

}

export default SignupForm;
